import React,{Component} from 'react'


class Navbar extends Component {
    render(){
        return(
        <React.Fragment>
            <div class="title">
                    <a routerLink=''>My First Blog</a>
            </div>
            <nav class="navbar">
                <a routerLink='/articles' class='nav-item'>Articles</a>
                <a routerLink='/about' class='nav-item'>About</a>
            </nav>
        </React.Fragment>
        
        )
    }
}


export default Navbar
